import styles from "./header.module.css"
function header () {
    return (
        <div className={styles.a}>
            <span>LOGo</span>
            <div className="header_menu">
                <a href="#">Войти</a>
                <a href="#">Зарегистрироваться</a>
            </div>
        </div>
    )
}

export default header
